import React from 'react'

export const Editor = (props) => {
    return (
      <div>
        <h1>Editor</h1>
        <textarea
          name="editor"
          id="editor"
          cols="30"
          rows="30"
          onChange={props.handleChange}
          value={props.input}
        ></textarea>
      </div>
    );
}
